import "./App.css";
import { BrowserRouter, Routes, Route } from "react-router-dom";
import Footer from "./Footer";
import MasterLayout from "./layouts/admin/MasterLayout";

function App() {
  return (
    <BrowserRouter>
        <Routes>
          <Route path="/about" element={<MasterLayout />}></Route>
        </Routes>
    </BrowserRouter>
  );
}

export default App;
